Rocky 2 1979

Verenigde Staten
Actie / Drama
119 minuten

geregisseerd door Sylvester Stallone
met Sylvester Stallone, Talia Shire en Carl Weathers

Rocky Balboa loopt een ernstige oogwonde op tijdens het gevecht 
met zwaargewicht Apollo Creed en moet geopereerd worden. Hoewel 
de ingreep geslaagd is, adviseren de artsen niet meer te boksen. 
Rocky volgt hun advies op maar ontdekt al snel dat het leven buiten 
de ring moeilijk en hard is. Hij heeft geen diploma's en moet zich 
tevreden stellen met slechtbetaalde baantjes. Daar komt nog bij dat 
zijn vrouw Adrian zwanger is. Rocky wil voor haar en de baby alles 
kopen wat hun hartjes verlangen.

